import "tailwindcss/tailwind.css";
import Link from 'next/link';

function MyApp({ Component, pageProps }) {
  return (
    <div className="flex flex-col h-screen">
      <header className="flex justify-between items-center px-4 py-3 border-b">
        <MenuIcon className="p-px text-blue-500 w-7 h-7" />
        <img className="h-10"
          src="https://s2.coinmarketcap.com/static/cloud/img/coinmarketcap_1.svg?_=61a2093"
        />
        <SearchIcon className="p-px text-blue-500 w-7 h-7" />
      </header>
      <main className="flex-1">
        <Component {...pageProps} />
      </main>
      <footer className="flex border-t border-gray-200">
          <Link
            href="/"
            className="flex items-center justify-center w-1/4 py-3"
          >

                <HomeIcon className="p-px text-blue-500 w-7 h-7" />


          </Link>

      </footer>

    </div>
  )
}

export default MyApp

function MenuIcon({ className }) {
  return (
    <svg viewBox="0 0 20 20" fill="currentColor" className="menu-alt3 w-6 h-6"><path fillRule="evenodd" d="M3 5a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zM3 10a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zM9 15a1 1 0 011-1h6a1 1 0 110 2h-6a1 1 0 01-1-1z" clipRule="evenodd" /></svg>
  );
}


function SearchIcon({ className }) {
  return (
    <svg viewBox="0 0 20 20" fill="currentColor" className="search w-6 h-6"><path fillRule="evenodd" d="M8 4a4 4 0 100 8 4 4 0 000-8zM2 8a6 6 0 1110.89 3.476l4.817 4.817a1 1 0 01-1.414 1.414l-4.816-4.816A6 6 0 012 8z" clipRule="evenodd" /></svg>
    );
  }

  function HomeIcon({ className }) {
    return (
<svg viewBox="0 0 20 20" fill="currentColor" className="home w-6 h-6"><path d="M10.707 2.293a1 1 0 00-1.414 0l-7 7a1 1 0 001.414 1.414L4 10.414V17a1 1 0 001 1h2a1 1 0 001-1v-2a1 1 0 011-1h2a1 1 0 011 1v2a1 1 0 001 1h2a1 1 0 001-1v-6.586l.293.293a1 1 0 001.414-1.414l-7-7z" /></svg>      
);
    }

    function PieIcon({ className }) {
      return (
<svg viewBox="0 0 20 20" fill="currentColor" className="chart-pie w-6 h-6"><path d="M2 10a8 8 0 018-8v8h8a8 8 0 11-16 0z" /><path d="M12 2.252A8.014 8.014 0 0117.748 8H12V2.252z" /></svg>    );
      }

      function DotsIcon({ className }) {
        return (
<svg viewBox="0 0 20 20" fill="currentColor" className="dots-horizontal w-6 h-6"><path d="M6 10a2 2 0 11-4 0 2 2 0 014 0zM12 10a2 2 0 11-4 0 2 2 0 014 0zM16 12a2 2 0 100-4 2 2 0 000 4z" /></svg>  );
        }
